export default function  Modal({ show, title, children, onClose }) {
  if (!show) return null;

  return (
    <div className="modal-backdrop" style={{
      position: "fixed",
      top: 0, left: 0, right: 0, bottom: 0,
      backgroundColor: "rgba(0,0,0,0.5)",
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      zIndex: 1050
    }}>
      <div className="bg-white p-4 rounded shadow" style={{ minWidth: "300px" }}>
        <h5>{title}</h5>
        <div>{children}</div>
        <button className="btn btn-secondary mt-3" onClick={onClose}>Close</button>
      </div>
    </div>
  );
}
